import React from 'react';
import { Route, BrowserRouter as Router, Routes } from 'react-router-dom';
import './App.css';

import { Brother } from '.src/Brother';
import { Carrito } from '.src/Carrito';
import Login from './src/Login';
import { Products } from './src/Products';
import Register from './src/Register';
import { Rome } from './src/Rome';
import { Home } from './src/home';
import { ListProduct } from './src/listProduct';
const App = () => {

  return (
    <Router>
      <div>





      </div>
      <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          <Route path="/home" element={<Home />} />
          <Route path="/brother" element={<Brother />} />
          <Route path="/rome" element={<Rome />} />
          <Route path="/products" element={<Products />} />
          <Route path="/carrito" element={<Carrito />} />
          <Route path="/listProducts" element={<ListProduct />} />
          {/* Agrega otras rutas si es necesario */}
        </Routes>

    </Router>
  );
};

export default App;
